import React, { useState } from 'react';

import styles from './CorposCelestes.module.css';
import CorpoCeleste from '../CorpoCeleste/CorpoCeleste';

function CorposCelestes(props) {
  const [corposCelestes, setCorposCelestes] = useState([
    {
      name: "Arcturus",
      fotoName: "arcturus",
      tipo: "estrela"
    },
    {
      name: "Marte",
      fotoName: "marte",
      tipo: "planeta",
    },
    {
      name: "Vênus",
      fotoName: "venus",
      tipo: "planeta"
    },
    {
      name: "Vega",
      fotoName: "vega",
      tipo: "planeta",
    },
    {
      name: "Spica",
      fotoName: "spica",
      tipo: "estrela",
    },
    {
      name: "Sagittarius A",
      fotoName: "sagittariusa",
      tipo: "buraco negro"
    },
    {
      name: "Júpiter",
      fotoName: "jupiter",
      tipo: "planeta"
    },
    {
      name: "Andromeda",
      fotoName: "andromeda",
      tipo: "estrela",
    }
  ]);

  return (
    <div className={styles.corposGridContainer}>
      <div className={styles.corposGrid}>
        {corposCelestes.map(corpo => {
          return <CorpoCeleste
            key={corpo.name}
            name={corpo.name}
            fotoname={corpo.fotoName}
          />
        })}
      </div>
    </div>
  );
}

export default CorposCelestes;
